if (version instanceof child.ChildProcess) {
    // ...
}
```
but as it stands, they're both interfaces, so the only way to disambiguate the union type is to use type-casting (e.g. <ChildProcess>).  Forcing this on the user leads to cumbersome syntax for almost zero type-safety gain, so i would suggest we just make this one overload return `any`, e.g.:

```javascript

    export function exec(command: string): ExecOutputReturnValue;
    export function exec(command: string, options: ExecOptions): any;
    export function exec(command: string, options: ExecOptions, callback: ExecCallback): child.ChildProcess;
    export function exec(command: string, callback: ExecCallback): child.ChildProcess;
```
